import React, { useEffect } from "react";
import PropTypes from "prop-types";
import PrizeWheel from "prize-wheel";

var settings = {
  el: "#wheel", // Canvas ID
  members: ["Hamburgers", "Tacos", "Steak", "Burritos", "asdasd"], // Array of members
  colors: ["#C7181D", "#FCB937", "#A1B836", "#371979", "#301979"], // Background color of each member
  radius: 250, // wheel radius
};

const WheelName = (props) => {
  useEffect(() => {
    var wheel = new PrizeWheel(settings);
    wheel.init();

    wheel.spin(function (member) {
      alert(member);
    });
  }, []);

  return <canvas id="wheel"></canvas>;
};

WheelName.propTypes = {};

export default WheelName;
